import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import React from 'react';
import Navbar from './components/Navbar';
import Tagline from './components/Tagline';
import Footer from './components/Footer';
import Home from './components/pages/Home';
import Capabilities from './components/pages/Capabilities';
import Works from './components/pages/Works';
import Studio from './components/pages/Studio';

import './App.css';

function App() {
  return (
    <>
      <Router>
        <Navbar />
        <section className='livestream-section'>
          <div className='livestream-container'>
            <div className='livestream-video-container'>
              <iframe className='livestream-video' title='livestream-video' src="https://vimeo.com/event/2049241/embed" frameborder="0" allow="autoplay; fullscreen; picture-in-picture" allowfullscreen ></iframe>
            </div>
            <iframe title='livestream-chat'src="https://vimeo.com/event/2049241/chat/" width="400" height="600" frameborder="0"></iframe>
          </div>
        </section>
        <Routes>
          <Route path='/' exact element={Home} />
          <Route path='/capabilities' element={Capabilities} />
          <Route path='/works' element={Works} />
          <Route path='/studio' element={Studio} />
        </Routes>
        <Tagline />
        <Footer />
      </Router>
    </>
  );
}

export default App;
